INSERT INTO `hrp_article` VALUES ('192', '新增中心目录使用方法00', '0', '# 中心目录新增使用说明(耗材目录)\n\n### 一、使用浏览器访问\n- 使用浏览器访问\n&gt; 内网电脑 访问此网址  [http://10.87.230.225/admin/test/showybdata](http://10.87.230.225/admin/test/showybdata)\n外网电脑使用此网址   [http://223.244.236.238:9999/admin/test/showybdata](http://223.244.236.238:9999/admin/test/showybdata)\n\n**如果浏览器不行请下载谷歌浏览器或360急速浏览器**\n这里是下载链接 【[360急速浏览器下载](/upload/20210405/318eab552b51f474f12a82fbe54d58f3.rar)】\n### 二、新增目录项目\n打开访问网址后 点击页面左上角的【新增中心数据】按钮  完善要求填写的内容后点击【确定】提交\n\n![图片alt](/upload/20210405/f443f0e71608c05018307eecc1db889b.png \'\'图片title\'\')\n![图片alt](/upload/20210405/d696551acd34ce08bdec11fa42ae2656.png \'\'图片title\'\')\n\n![图片alt](/upload/20210405/7a6d3185134e93bf4e24c047e6035778.png \'\'图片title\'\')\n\n### 三、项目对码\n打开【九阵系统】-【接口】-【P滁州市医保】-【目录管理】-【密码为当前日期OK 如20210405OK】-【中心目录对码】\n将刚才添加的项目完成和本地项目的对码即可\n![图片alt](/upload/20210405/e4343c58de606da46155c72ad54a998f.png \'\'图片title\'\')\n\n&gt; **注意事项：对于部分没有安装接口功能的电脑需要安装接口功能才可以使用对码操作**\n下载【[医保接口文件20210401](/upload/20210405/e975c2915f3995f459ee6daa3236f2cb.zip)】解压后替换至九阵系统的根目录下  替换前要先退出九阵系统  然后重新打开登录系统即可\n操作方法如下：\n\n![图片alt](/upload/20210405/e0fda493eb5af542d108feef08263aac.png \'\'图片title\'\')\n![图片alt](/upload/20210405/a71bb88c1ee04b575e7a2c65b6e200d2.png \'\'图片title\'\')\n![图片alt](/upload/20210405/84f16b7a8ad90f913ac7f2c649f2a681.png \'\'图片title\'\')\n![图片alt](/upload/20210405/e4a283cb07e33dc8e31923431c6337fa.png \'\'图片title\'\')\n![图片alt](/upload/20210405/8a5731eac70d3c5f31e4d80bc9932c3f.png \'\'图片title\'\')\n\n\n\n\n\n\n\n\n***\n\n\n\n', '1614997462', '1618982678', null);
INSERT INTO `hrp_article` VALUES ('193', '企业办公系统-企业云盘功能启用通知', '0', '## 企业办公系统-企业云盘功能启用通知\n[TOC]\n### 一、企业云盘功能电脑端使用说明\n在任意一台客户端机器上，打开浏览器（建议选择火狐或谷歌浏览器），在弹出的浏览器界面的地址栏中输企业办公系统的地址\n[外网电脑登录网址http://223.244.236.238:9999/admin/login/index](http://223.244.236.238:9999/admin/login/index) \n【[内网电脑登录网址http://10.87.230.225/admin/login/index](http://10.87.230.225/admin/login/index)】\n### 1. 系统登录\n登录页面，如下图所示。\n![图片alt](/upload/20210421/a6a757346a680efccf6fedcce83f2c77.png \'\'图片title\'\')\n\n【登录账号】为系统中预留的手机号码\n【密码】默认密码为 123456   请在登录后修改密码\n\n### 2. 登录成功界面如下\n![图片alt](/upload/20210421/7986d70d04df62c96bd018a5d8ce04ec.png \'\'图片title\'\')\n### 3. 用户绑定\n部分用户在九阵系统中没有预留手机号码需要在登录页面下点击【绑定手机号】完成账户绑定操作，界面如下：\n![图片alt](/upload/20210421/5259e1a5d961ad12e638f759edccc316.png \'\'图片title\'\')\n![图片alt](/upload/20210421/34316166fa22e9bcf26ec487b7448791.png \'\'图片title\'\')\n### 4. 企业云盘\n依次点击【办公】-【企业云盘】-【公共云盘】\n界面如下\n![图片alt](/upload/20210421/24512d4c964d386ea717834f38f4940a.jpg \'\'图片title\'\')\n#### 1） 上传文件\n点击![图片alt](/upload/20210421/b2e98b7aaddbb4c1f40ba79fb8bd0ae8.png \'\'图片title\'\')  调用文件上传功能。点击![图片alt](/upload/20210421/6d341ead2e508fcf9e60c584f781f3ab.png \'\'图片title\'\')  可以在当前目录下新建文件夹。\n#### 2） 文件删除\n点击![图片alt](/upload/20210421/fdd3016eb1af8f68a7323a3395c0bfa2.png \'\'图片title\'\') 可以删除被选中的文件，不能删除他人上传的公共数据。用户仅有删除自己上传的文件权限。管理员具有上传所有公共文件权限。【个人云盘】中的数据 仅自己可以操作，对于其他用户不可见，包括管理员。\n\n#### 3） 文件查看、下载、修改\n实时查看功能目前仅支持图片和视频，点击文件操作栏![图片alt](/upload/20210421/0ea4317668a8dbefb1b877474d36eec0.png \'\'图片title\'\')按钮即可 预览文件\n点击 ![图片alt](/upload/20210421/e52a6f223041e79115ac66446ac88405.png \'\'图片title\'\') 按钮可下载文件到本地\n点击 ![图片alt](/upload/20210421/23d829ccd186d77f04a4a877d50aef77.png \'\'图片title\'\')  修改按钮可对文件进行重命名。\n\n#### 4） 个人云盘\n【个人云盘】操作同【公共云盘】操作一致。\n### 二、企业云盘手机端使用说明\n手机登录入口为【企业微信】-【工作台】-【企业办公系统】\n写字太累了。。。我录了一个手机端操作视频。请点击最下方的播放按钮\n\n\n&lt;sub&gt;\n   &lt;video   controls &gt; \n     &lt;source src=&quot;/upload/20210421/c99fe1923b3ede9dbf24fd45b23645e3.mp4&quot;&gt; \n    &lt;/video&gt;\n&lt;/sub&gt;\n\n### 三、其他功能\n&gt; 会在后期陆续开放 \n\n***\n', '1618983355', '1618994781', null);
