INSERT INTO `hrp_system_log_202104` VALUES ('1897', '1', '/admin/article.article/autoSave', 'post', '', '{\"id\":\"192\",\"title\":\"新增中心目录使用方法00\",\"content\":\"# 中心目录新增使用说明(耗材目录)\\n\\n### 一、使用浏览器访问\\n- 使用浏览器访问\\n&gt; 内网电脑 访问此网址  [http:\\/\\/10.87.230.225\\/admin\\/test\\/showybdata](http:\\/\\/10.87.230.225\\/admin\\/test\\/showybdata)\\n外网电脑使用此网址   [http:\\/\\/223.244.236.238:9999\\/admin\\/test\\/showybdata](http:\\/\\/223.244.236.238:9999\\/admin\\/test\\/showybdata)\\n\\n**如果浏览器不行请下载谷歌浏览器或360急速浏览器**\\n这里是下载链接 【[360急速浏览器下载](\\/upload\\/20210405\\/318eab552b51f474f12a82fbe54d58f3.rar)】\\n### 二、新增目录项目\\n打开访问网址后 点击页面左上角的【新增中心数据】按钮  完善要求填写的内容后点击【确定】提交\\n\\n![图片alt](\\/upload\\/20210405\\/f443f0e71608c05018307eecc1db889b.png \'\'图片title\'\')\\n![图片alt](\\/upload\\/20210405\\/d696551acd34ce08bdec11fa42ae2656.png \'\'图片title\'\')\\n\\n![图片alt](\\/upload\\/20210405\\/7a6d3185134e93bf4e24c047e6035778.png \'\'图片title\'\')\\n\\n### 三、项目对码\\n打开【九阵系统】-【接口】-【P滁州市医保】-【目录管理】-【密码为当前日期OK 如20210405OK】-【中心目录对码】\\n将刚才添加的项目完成和本地项目的对码即可\\n![图片alt](\\/upload\\/20210405\\/e4343c58de606da46155c72ad54a998f.png \'\'图片title\'\')\\n\\n&gt; **注意事项：对于部分没有安装接口功能的电脑需要安装接口功能才可以使用对码操作**\\n下载【[医保接口文件20210401](\\/upload\\/20210405\\/e975c2915f3995f459ee6daa3236f2cb.zip)】解压后替换至九阵系统的根目录下  替换前要先退出九阵系统  然后重新打开登录系统即可\\n操作方法如下：\\n\\n![图片alt](\\/upload\\/20210405\\/e0fda493eb5af542d108feef08263aac.png \'\'图片title\'\')\\n![图片alt](\\/upload\\/20210405\\/a71bb88c1ee04b575e7a2c65b6e200d2.png \'\'图片title\'\')\\n![图片alt](\\/upload\\/20210405\\/84f16b7a8ad90f913ac7f2c649f2a681.png \'\'图片title\'\')\\n![图片alt](\\/upload\\/20210405\\/e4a283cb07e33dc8e31923431c6337fa.png \'\'图片title\'\')\\n![图片alt](\\/upload\\/20210405\\/8a5731eac70d3c5f31e4d80bc9932c3f.png \'\'图片title\'\')\\n\\n\\n\\n\\n\\n\\n\\n\\n***\\n\\n\\n\\n\"}', '192.168.17.233', 'Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/86.0.4240.198 Safari/537.36', '1618982668');
