INSERT INTO `hrp_system_log_202104` VALUES ('2427', '1', '/admin/article.article/autoSave', 'post', '', '{\"id\":\"193\",\"title\":\"企业办公系统-企业云盘功能启用通知\",\"content\":\"\\n\\n## 企业办公系统-企业云盘功能启用通知\\n[TOC]\\n### 一、企业办公系统介绍\\n医院综合运营管理系统 H-ERP 是现代医院运营管理的信息化系统，它填补了医院后台业务管理\\n系统的空白。该产品系列融合诸多先进的、符合国情现状的管理理念，为医院建立起一整套以会计\\n为核心，预算为主线，物流、固定资产和成本为基础，人力资源和绩效为杠杆的医院运营管理目标\\n决策体系，实现了运营管理中的“物流、资金流、业务流、信息流、控制流”的统一，帮助医院管 理者建立综合运营管理平台，增强对人、财、物各项综合资源的计划、使用、协调、控制、评价和\\n激励等方面的管理。它的使命是确保医院平稳、安全、健康的经济运行。\\n医院人力资源管理是指医院对人力资源的获取、开发、保持和利用等方面所进行的计划、组织、\\n指挥和控制的活动，是通过协调医院内部人与事关系乃至医院与社会关系，以充分开发人力资源，\\n挖掘人的潜力，调动人的积极性，提供工作效率，实现医院战略发展目标的理论、方法、工具和技\\n术。主要的人力资源管理活动包括工作分析和人力资源规划、人才招聘、员工培训、薪酬福利、绩\\n效考核等，并通过一系列统计分析活动为领导决策提供依据。\\n医院人力资源管理系统，是指借助计算机信息系统高效规范的特点对医院日常人力资源管理活\\n动相关业务进行记录、统计、分析等，为医院各级人力资源管理者提供详实准确高效的人力资源信\\n息数据，为医院领导提供人力资源决策依据，进而帮助医院提高人力资源管理效率和人力资源管理\\n水平。\\n### 二、云盘功能介绍\\n\\n\\n### 三、项目发展介绍\\n\\n\\n这是一个视频\\n\\n&lt;sub&gt;\\n   &lt;video width=&quot;350px&quot;  controls &gt; \\n     &lt;source src=&quot;\\/upload\\/20210421\\/c99fe1923b3ede9dbf24fd45b23645e3.mp4&quot;&gt; \\n    &lt;\\/video&gt;\\n&lt;\\/sub&gt;\\n\"}', '192.168.17.233', 'Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/86.0.4240.198 Safari/537.36', '1618989781');
