INSERT INTO `hrp_system_log_202104` VALUES ('2842', '1', '/admin/article.article/autoSave', 'post', '', '{\"id\":\"193\",\"title\":\"企业办公系统-企业云盘功能启用通知\",\"content\":\"\\n## 企业办公系统-企业云盘功能启用通知\\n[TOC]\\n### 一、企业云盘功能电脑端使用说明\\n在任意一台客户端机器上，打开浏览器（建议选择火狐或谷歌浏览器），在弹出的浏览器界面的地址栏中输企业办公系统的地址\\n[外网电脑登录网址http:\\/\\/223.244.236.238:9999\\/admin\\/login\\/index](http:\\/\\/223.244.236.238:9999\\/admin\\/login\\/index) \\n【[内网电脑登录网址http:\\/\\/10.87.230.225\\/admin\\/login\\/index](http:\\/\\/10.87.230.225\\/admin\\/login\\/index)】\\n### 1. 系统登录\\n登录页面，如下图所示。\\n![图片alt](\\/upload\\/20210421\\/a6a757346a680efccf6fedcce83f2c77.png \'\'图片title\'\')\\n\\n【登录账号】为系统中预留的手机号码\\n【密码】默认密码为 123456   请在登录后修改密码\\n\\n### 2. 登录成功界面如下\\n![图片alt](\\/upload\\/20210421\\/7986d70d04df62c96bd018a5d8ce04ec.png \'\'图片title\'\')\\n### 3. 用户绑定\\n部分用户在九阵系统中没有预留手机号码需要在登录页面下点击【绑定手机号】完成账户绑定操作，界面如下：\\n![图片alt](\\/upload\\/20210421\\/5259e1a5d961ad12e638f759edccc316.png \'\'图片title\'\')\\n![图片alt](\\/upload\\/20210421\\/34316166fa22e9bcf26ec487b7448791.png \'\'图片title\'\')\\n### 4. 企业云盘\\n依次点击【办公】-【企业云盘】-【公共云盘】\\n界面如下\\n![图片alt](\\/upload\\/20210421\\/24512d4c964d386ea717834f38f4940a.jpg \'\'图片title\'\')\\n#### 1） 上传文件\\n点击![图片alt](\\/upload\\/20210421\\/b2e98b7aaddbb4c1f40ba79fb8bd0ae8.png \'\'图片title\'\')  调用文件上传功能。点击![图片alt](\\/upload\\/20210421\\/6d341ead2e508fcf9e60c584f781f3ab.png \'\'图片title\'\')  可以在当前目录下新建文件夹。\\n#### 2） 文件删除\\n点击![图片alt](\\/upload\\/20210421\\/fdd3016eb1af8f68a7323a3395c0bfa2.png \'\'图片title\'\') 可以删除被选中的文件，不能删除他人上传的公共数据。用户仅有删除自己上传的文件权限。管理员具有上传所有公共文件权限。【个人云盘】中的数据 仅自己可以操作，对于其他用户不可见，包括管理员。\\n\\n#### 3） 文件查看、下载、修改\\n实时查看功能目前仅支持图片和视频，点击文件操作栏![图片alt](\\/upload\\/20210421\\/0ea4317668a8dbefb1b877474d36eec0.png \'\'图片title\'\')按钮即可 预览文件\\n点击 ![图片alt](\\/upload\\/20210421\\/e52a6f223041e79115ac66446ac88405.png \'\'图片title\'\') 按钮可下载文件到本地\\n点击 ![图片alt](\\/upload\\/20210421\\/23d829ccd186d77f04a4a877d50aef77.png \'\'图片title\'\')  修改按钮可对文件进行重命名。\\n\\n#### 4） \\n### 二、企业云盘手机端使用说明\\n写字太累了。。。我录了一个手机端操作视频。请点击最下方的播放按钮\\n\\n\\n&lt;sub&gt;\\n   &lt;video width=&quot;350px&quot;  controls &gt; \\n     &lt;source src=&quot;\\/upload\\/20210421\\/c99fe1923b3ede9dbf24fd45b23645e3.mp4&quot;&gt; \\n    &lt;\\/video&gt;\\n&lt;\\/sub&gt;\\n\"}', '192.168.17.233', 'Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/86.0.4240.198 Safari/537.36', '1618993784');
