说明\\n手机登录入口为【企业微信】-【工作台】-【企业办公系统】\\n写字太累了。。。我录了一个手机端操作视频。请点击最下方的播放按钮\\n\\n\\n&lt;sub&gt;\\n   &lt;video   controls &gt; \\n     &lt;source src=&quot;\\/upload\\/20210421\\/c99fe1923b3ede9dbf24fd45b23645e3.mp4&quot;&gt; \\n    &lt;\\/video&gt;\\n&lt;\\/sub&gt;\\n\"}', '192.168.17.233', 'Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/86.0.4240.198 Safari/537.36', '1618994710');
